import React from 'react';
import styled from 'styled-components';

// Styled components for styling
const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 20px;
`;

const Landing = styled.div`
  background-color: #f8f8f8;
  padding: 100px 0;
  text-align: center;
`;

const Carousel = styled.div`
  /* Add carousel styles here */
`;

const Feed = styled.div`
  /* Add feed styles here */
`;

const Navigation = styled.nav`
  background-color: #333;
  color: #fff;
  padding: 10px 0;
`;

const DropdownMenu = styled.ul`
  display: none;
  position: absolute;
  background-color: #333;
  color: #fff;
  padding: 10px;
  z-index: 1;

  li {
    padding: 5px 0;
  }

  /* Show dropdown on hover */
  &:hover {
    display: block;
  }
`;

const NavbarItem = styled.li`
  display: inline-block;
  padding: 0 10px;
  cursor: pointer;
  position: relative;

  &:hover ${DropdownMenu} {
    display: block;
  }
`;

const HomePage = () => {
  return (
    <Container>
      <Navigation>
        <ul>
          <NavbarItem>
            Home
            <DropdownMenu>
              <li>Submenu 1</li>
              <li>Submenu 2</li>
            </DropdownMenu>
          </NavbarItem>
          <NavbarItem>About</NavbarItem>
          <NavbarItem>Services</NavbarItem>
          <NavbarItem>Contact</NavbarItem>
        </ul>
      </Navigation>
      <Landing>
        <h1>Welcome to My Website</h1>
        <p>Your catchy slogan here</p>
      </Landing>
      <Carousel>{/* Add carousel content here */}</Carousel>
      <Feed>{/* Add feed content here */}</Feed>
    </Container>
  );
};

export default HomePage;
